script: |
  super -f text -I q9161.spq | sort > q9161.out

inputs:
  - name: q9161.spq
    data: |
      SELECT DISTINCT tab1.col1 + - col0 AS col2 FROM tab1 (FORMAT parquet) WHERE ( NOT NULL NOT IN ( + col1 * + col1 ) AND NOT NULL IN ( tab1.col1 + col0 ) ) AND + col0 NOT IN ( tab1.col1 );
  - name: tab1

outputs:
  - name: q9161.out
    data: |
